function detailDocumentRepositoryDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-DocumentRepository-detail').modal('show');

				$('#Detail-DocumentRepository-Base64').val(data.base64);
				$('#Detail-DocumentRepository-Code').val(data.code);
				$('#Detail-DocumentRepository-Description').val(data.description);
				$('#Detail-DocumentRepository-Filename').val(data.filename);
				$('#Detail-DocumentRepository-Modul').val(data.modul);
				$('#Detail-DocumentRepository-Subject').val(data.subject);

}
